import React from 'react';
import './style.css';
import Aside from './components/aside/Aside';
import Main from './components/main/Main';
import Right from './components/right/Right';

function App() {
  return (
    <div className="App">
      <div className="container">
        <Aside/>
        <Main/>
        <Right/>
      </div>
    </div>
  );
}

export default App;
